import React from 'react'
import { Layout } from "../../components";

export const AgregarTarea = () => {
    return (
        <div>
            <Layout>

                <h1>Agregar Tareas</h1>
                <form>
                    <input placeholder='Titulo'></input>
                </form>

            </Layout>

        </div>
    )
}
